import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Escolhas from './Escolhas'; // Importando Escolhas.js
import TabelaUsuarios from './TabelaUsuarios'; // Ou o componente que você deseja exibir para usuários

import './App.css';

function App() {
  return (
    <Router>
      <div className="IterMob">
        <Routes>
          <Route path="/" element={<Escolhas />} />
          <Route path="/usuarios" element={<TabelaUsuarios />} /> {/* Rota para TabelaUsuarios */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
